// ITEquipmentLanding.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ITEquipmentLanding.css'; // Create this CSS file for styles

const ITEquipmentLanding = () => {
  const navigate = useNavigate();

  return (
    <div className="landing-container">
      <div className="card" onClick={() => navigate('/it-equipment-view')}>
        <div className="card-content">
          <h3>View IT Equipments</h3>
          <p>More info</p>
        </div>
      </div>
      <div className="card" onClick={() => navigate('/it-equipment-manager')}>
        <div className="card-content">
          <h3>Modify IT Equipments</h3>
          <p>More info</p>
        </div>
      </div>
    </div>
  );
};

export default ITEquipmentLanding;
